import React from 'react';
import Chart from '../Chart/Chart';

const ExpensesChart = ({ expenses }) => {
  const configData = [
    { label: 'Jan', value: 0 },
    { label: 'Feb', value: 0 },
    { label: 'March', value: 0 },
    { label: 'April', value: 0 },
    { label: 'May', value: 0 },
    { label: 'Jun', value: 0 },
    { label: 'Jul', value: 0 },
    { label: 'Aug', value: 0 },
    { label: 'Sep', value: 0 },
    { label: 'Oct', value: 0 },
    { label: 'Nov', value: 0 },
    { label: 'Dec', value: 0 },
  ];

  for (const expense in expenses) {
    const expenseMonth = expenses[expense].date.getMonth();
    configData[expenseMonth].value += expense.amount;
  }

  return <Chart chartConfigData={configData} />;
};

export default ExpensesChart;
